?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Основатель этой знаменитой компании Карло Крокко, в течение долгого времени изучал различные известные часовые бренды и их коллекции. После долгого исследования, он пришел к выводу, что в большинстве часов, выпущенных различными брендами, так или иначе присутствуют элементы классического дизайна. И у него появилась идея о создании оригинального и особенного бренда, который будет узнаваем лишь по одному виду. Первую модель собственных часов бренд выпустил в конце 20-го века, в 1980 году. Данная модель просто поразила часовую общественность: о сочетании золота и резины еще никто и никогда не задумывался. Всего лишь за 10 лет, компания Hublot смогла завоевать доверие на всемирном часовом рынке. Глава компании, утверждает, что их задача состоит не в том, чтобы конкурировать с различными швейцарскими брендами, а в том, чтобы предлагать обществу совершено инновационные дизайнерские решения. Компания Hublot выпускает несколько линеек часов, стиль которых начинается со спортивного, а заканчивается роскошным и элегантным.</span></span></p>
 
